import React, { Component } from 'react'
import data from '../../assets/json/data'

const citiesData = data;

class CitiesPage extends Component {
    render() {
        return (
            <div className="container">
                <ul>
                   { citiesData.map((city, index) => {
                       <div key={index}>
                           <p>{city.name}</p>
                           <img src={city.image}/>
                       </div>
                    })}
                </ul>
            </div>
        )
    }
}

export default CitiesPage;
